def calculate_overhead(admin_overhead, skill_coo):
    overhead = admin_overhead if admin_overhead is not None else 1
    return overhead - ((overhead - 1) * skill_coo) / 100

def get_economy_state_resource_info(econ_state, resource_id, quality_variable_idk_yet):
    return (
        econ_state_constants[econ_state][str(resource_id)]
        if quality_variable_idk_yet is None
        else econ_state_constants[econ_state][resource_id].quality[
            quality_variable_idk_yet
        ]
    )

def vIr(t, e, r, n):
    return e + (t + n) / r

def yIr(t, e, r, n, i):
    a = (n + t) / ((e - i) * (e - i))
    return t - (r - e) * (r - e) * a

def bIr(t, e, r, n, i=1):
    return (i * ((n - e) * 3600) - r) / (t + r)

def mIr(building_salary_modifier, econ_state, quality, saturation, quantity, price):
    p = min(max(2 - saturation, 0), 2)
    h = max(0.9, p / 2 + 0.5)
    quality_normalized = quality / 12
    building_salary = building_salary_modifier if building_salary_modifier is not None else 1
    s = (
        econ_state["modeledStoreWages"]
        if econ_state["modeledStoreWages"] is not None
        else 0
    )
    m = (
        core_constants["PROFIT_PER_BUILDING_LEVEL"]
        * (
            econ_state["buildingLevelsNeededPerUnitPerHour"]
            * econ_state["modeledUnitsSoldAnHour"]
            + 1
        )
        * building_salary
        * ((p / 2) * (1 + quality_normalized * core_constants["RETAIL_MODELING_QUALITY_WEIGHT"]))
        + s
    )
    v = econ_state["modeledUnitsSoldAnHour"] * h
    c = (
        econ_state["modeledStoreWages"]
        if econ_state["modeledStoreWages"] is not None
        else 0
    )
    b = vIr(m, econ_state["modeledProductionCostPerUnit"], v, c)
    h = yIr(m, b, price, c, econ_state["modeledProductionCostPerUnit"])
    return bIr(h, econ_state["modeledProductionCostPerUnit"], c, price, quantity)

def calculate_total_time(
    building_salary_modifier,
    econ_state,
    quantity,
    sales_modifier,
    price,
    quality,
    saturation,
    acceleration_event,
    building_level,
    season_modifier,):
    d = mIr(building_salary_modifier, econ_state, quality, saturation, quantity, price)
    if d <= 0:
        return None
    p = d / acceleration_event / building_level
    h = p - (p * sales_modifier) / 100
    if season_modifier is not None:
        return h / season_modifier["sellingSpeedMultiplier"]
    else:
        return h

def calculate_retail(
    building_level,
    resource_id,
    price,
    quantity,
    quality,
    cogs,
    sales_modif_with_bonus,
    skill_cmo,
    skill_coo,
    acceleration,
    economyState,
    admin_overhead,
    weather,
    resource_info,
    building_info,
    r=None,
    forceQuality=None,):
    if quantity is None or quality is None:
        print("fiyat veya miktar yok")
        return {
            "revenue": None,
            "wagesTotal": None,
            "secondsToFinish": None,
            "profit": None,
            "profitPerSeconds": None,
        }
    wages = resource_info[1]["storeBaseSalary"] * building_level
    sales_modif = sales_modif_with_bonus + math.floor(skill_cmo / 3)
    overhead = calculate_overhead(admin_overhead, skill_coo)
    total_time = calculate_total_time(
        building_info["salaryModifier"],
        get_economy_state_resource_info(
            economyState,
            resource_id,
            forceQuality if forceQuality is not None else None,
        ),
        quantity,
        sales_modif,
        price,
        (quality if quality is not None else 0) if forceQuality is None else 0,
        resource_info[1]["marketSaturation"],
        acceleration,
        building_level,
        weather if resource_info[0]["retailSeason"] is season_names["SUMMER"] else None,
    )
    if total_time is None:
        return {
            "revenue": None,
            "wagesTotal": None,
            "secondsToFinish": None,
            "profit": None,
            "profitPerSeconds": None,
        }
    revenue = price * quantity
    wages_total = math.ceil((total_time * wages * acceleration * overhead) / 60 / 60)
    profit = revenue - wages_total - (cogs if cogs is not None else 0)
    return {
        "revenue": revenue,
        "wagesTotal": wages_total,
        "secondsToFinish": total_time,
        "profit": profit,
    }

def fix_overshoot(hours,resource_quality_seconds,resource_quality_array,total_quantity,total_cost,average_quality,seconds_to_finish,highest_quality):
    overshot_seconds = hours * 3600 - seconds_to_finish
    if overshot_seconds < 0:
        overshot_by =  round(abs(overshot_seconds) / resource_quality_seconds[highest_quality])
        if overshot_by > 0:
            previous_quantity = total_quantity
            total_quantity -= overshot_by
            total_cost -= resource_quality_array[highest_quality]["cost"] / resource_quality_array[highest_quality]["amount"] * overshot_by
            seconds_to_finish -= overshot_by * resource_quality_seconds[highest_quality]
            average_quality = (average_quality * previous_quantity - highest_quality * overshot_by) / total_quantity
    elif overshot_seconds > 0:
        while True:
            if highest_quality == -1:
                print("sctn yeterli rn ckmad hac eywah")
                break
            if resource_quality_array[highest_quality] is None:
                highest_quality -= 1
                continue
            available_seconds = resource_quality_seconds[highest_quality] * resource_quality_array[highest_quality]["amount"]
            if overshot_seconds - available_seconds < 0:
                overshot_by =  round(abs(overshot_seconds) / resource_quality_seconds[highest_quality])
                previous_quantity = total_quantity
                total_quantity += overshot_by
                total_cost += resource_quality_array[highest_quality]["cost"] / resource_quality_array[highest_quality]["amount"] * overshot_by
                seconds_to_finish += overshot_by * resource_quality_seconds[highest_quality]
                average_quality = (average_quality * previous_quantity + highest_quality * overshot_by) / total_quantity
                break
            previous_quantity = total_quantity
            total_quantity += resource_quality_array[highest_quality]["amount"]
            total_cost += resource_quality_array[highest_quality]["cost"]
            seconds_to_finish += resource_quality_array[highest_quality]["amount"] * resource_quality_seconds[highest_quality]
            average_quality = (average_quality * previous_quantity + highest_quality * resource_quality_array[highest_quality]["amount"]) / total_quantity
            highest_quality -= 1

    return total_quantity,total_cost,average_quality

def calculate_optimum_price(
    building_level,
    resource_id,
    quantity,
    quality,
    cost,
    sales_modif,
    skill_cmo,
    skill_coo,
    acceleration,
    economy_state,
    admin_overhead,
    weather,
    resource_info,
    building_info):

    optimum_price = None
    max_profit = 0
    seconds_to_finish = math.inf

    for i in range(0, int(resource_info[1]["averageRetailPrice"] * 20)):
        result = calculate_retail(
            building_level,
            resource_id,
            i / 10,
            quantity,
            quality,
            cost,
            sales_modif,
            skill_cmo,
            skill_coo,
            acceleration,
            economy_state,
            admin_overhead,
            weather,
            resource_info,
            building_info
        )
        if result["profit"] is not None:
            if result["profit"] / result["secondsToFinish"] > max_profit / seconds_to_finish:
                max_profit = result["profit"]
                seconds_to_finish = result["secondsToFinish"]
                optimum_price = i / 10
    return optimum_price, seconds_to_finish

def generate_price_seconds_array(
    building_level,
    resource_id,
    optimum_price,
    resource_quality_array,
    quality,
    sales_modif,
    skill_cmo,
    skill_coo,
    acceleration,
    economy_state,
    admin_overhead,
    weather,
    resource_info,
    building_info):

    resource_quality_seconds = [0] * 13
    for index,resource in enumerate(resource_quality_array):
        if resource is not None:
            seconds = calculate_retail(
                building_level,
                resource_id,
                optimum_price,
                resource["amount"],
                quality,
                resource["cost"],
                sales_modif,
                skill_cmo,
                skill_coo,
                acceleration,
                economy_state,
                admin_overhead,
                weather,
                resource_info,
                building_info)["secondsToFinish"] / resource["amount"]
            resource_quality_seconds[index] = seconds
    return resource_quality_seconds

def find_optimal_sale_for_hours(
        hours,
        building_level,
        resource_id,
        resource_quality_array,
        sales_modif,
        skill_cmo,
        skill_coo,
        economy_state,
        admin_overhead,
        weather,
        acceleration,
        resource_info,
        building_info):
    total_cost = 0
    total_quantity = 0
    quality_quantity_array = [0] * 13

    highest_quality = 12
    seconds_left = hours * 3600

    # ballpark guess how many resources are required
    while True:
        quantity = 0
        if highest_quality == -1:
            print("kailte kontrol sonu envanterden ckmad hac")
            break
        if resource_quality_array[highest_quality] is None:
            highest_quality -= 1
            continue

        quality = highest_quality
        quantity = resource_quality_array[quality]["amount"]
        cost = resource_quality_array[quality]["cost"]

        _,seconds_to_finish = calculate_optimum_price(
          building_level,
          resource_id,
          quantity,
          quality,
          cost,
          sales_modif,
          skill_cmo,
          skill_coo,
          acceleration,
          economy_state,
          admin_overhead,
          weather,
          resource_info,
          building_info)

        seconds_left -= seconds_to_finish
        if seconds_left < 0:
            overshot_amount = abs(round(seconds_left / (seconds_to_finish / quantity)))
            if overshot_amount > 0:
                total_quantity += quantity - overshot_amount
                total_cost += cost / quantity * (quantity - overshot_amount)
                quality_quantity_array[quality] = quantity - overshot_amount
                break
        total_quantity += quantity
        total_cost += cost
        quality_quantity_array[quality] = quantity
        highest_quality -= 1

    # calculate average_quality
    average_quality = 0
    for index,quantity in enumerate(quality_quantity_array):
        average_quality += index * quantity/ total_quantity

    optimum_price,seconds_to_finish = calculate_optimum_price(
        building_level,
        resource_id,
        total_quantity,
        average_quality,
        total_cost,
        sales_modif,
        skill_cmo,
        skill_coo,
        acceleration,
        economy_state,
        admin_overhead,
        weather,
        resource_info,
        building_info)

    resource_quality_seconds = generate_price_seconds_array(
        building_level,
        resource_id,
        optimum_price,
        resource_quality_array,
        quality,
        sales_modif,
        skill_cmo,
        skill_coo,
        acceleration,
        economy_state,
        admin_overhead,
        weather,
        resource_info,
        building_info)

    ## Improve on the previous guess
    total_quantity,total_cost,average_quality = fix_overshoot(hours,resource_quality_seconds,resource_quality_array,total_quantity,total_cost,average_quality,seconds_to_finish,highest_quality)

    optimum_price,seconds_to_finish  = calculate_optimum_price(
        building_level,
        resource_id,
        total_quantity,
        average_quality,
        total_cost,
        sales_modif,
        skill_cmo,
        skill_coo,
        acceleration,
        economy_state,
        admin_overhead,
        weather,
        resource_info,
        building_info
    )

    return total_quantity,total_cost,optimum_price,seconds_to_finish,average_quality
